import React, { Component } from 'react';
import Chat from './Chat';

const rules = [
  { type: 'String', message: 'Please Enter your SSO ID:', name: 'ssoid' },
  { type: 'String', message: 'Please Enter your Modality:', name: 'modality' },
  "Please feel free to ask us any of the queries",
  {
    type: 'SingleChoice',
    name: 'question',
    message: 'Here are some common queries you can ask:',
    options: [
      { label: 'Working Hours', value: 'What are the working hours?',  },
      { value: 'How to apply for leave?', label: 'Apply for Leave' },
      { value: 'Where can I find the project documentation?', label: 'Project Documentation' },
      { value: 'How to contact IT support?', label: 'IT Support' }
    ]
  }
];

class App extends Component {
  render() {
    return (
      <div className="App">
        <Chat rules={rules} />
      </div>
    );
  }
}

export default App;
